import React, { useState } from 'react';
import './Doctor.css';

function DoctorComponent() {
  const account_address = "123 Main St."; 
  const [patientAddress, setPatientAddress] = useState('');
  const [patientUpdateInfo, setPatientUpdateInfo] = useState('');

  const readPermission = () => {
    // handle read permission logic here
  };

  const writePermission = () => {
    // handle write permission logic here
  };

  const onFileSelected = (event) => {
    // handle file selection logic here
  };

  const updatePatientData = () => {
    // handle patient data update logic here
  };

  return (
    <div className="doctor-body-container">
      <div className="request-approval-container">
        {/* FOR THE LEFT SIDE */}
        <h1>Left Side</h1>
      </div>
      {/* FOR THE RIGHT SIDE */}
      <div className="profile-container">
        <span className="icon-text-container">
          <div className="account_address">
            {account_address} <mat-icon className="profile-icon">account_circle</mat-icon>
          </div> {/* To display the account address of the doctor */}
        </span>
        <h2>Need Someone's Data?</h2>
        <div className="request_approval">
          <input type="text" className="address-input" placeholder="Enter the address of the patient!" value={patientAddress} onChange={(e) => setPatientAddress(e.target.value)} /> {/* Store the address */}
          <div className="button-container">
            <button onClick={readPermission} className="read-button">Read Request</button>
            <button onClick={writePermission} className="write-button">Write Request</button>
            <input className="input-class" type="file" id="file" multiple onChange={onFileSelected} />
            <label className="input-label" htmlFor="file"></label>
            <input type="text" className="upadate-data-input" placeholder="Update with the details like medication etc..!" value={patientUpdateInfo} onChange={(e) => setPatientUpdateInfo(e.target.value)} /> {/* Store the address */}
          </div>
        </div>
        <button className="update-patient-timeline" onClick={updatePatientData}>Update Data</button>
      </div>
    </div>
  );
}

export default DoctorComponent;
